-- WataX

local Players = game:GetService("Players")
local RunService = game:GetService("RunService")
local HttpService = game:GetService("HttpService")

-- flag
local isActive = false
local isBeton = false
local animConn
local isRunning = false
local routes = {}

local player = Players.LocalPlayer
local hrp = player.Character and player.Character:WaitForChild("HumanoidRootPart")

local delayTime = 0.04
local function setup(char)
    local humanoid = char:WaitForChild("Humanoid")
    local root = char:WaitForChild("HumanoidRootPart")
    local lastPos = root.Position

    if animConn then animConn:Disconnect() end
    animConn = RunService.RenderStepped:Connect(function()
        if not root or not root.Parent then return end

        if isActive then
            local direction = (root.Position - lastPos)
            local dist = direction.Magnitude
            if dist > 0.01 then
                local moveVector = direction.Unit * math.clamp(dist*5,0,1)
                humanoid:Move(moveVector,false)
            else
                humanoid:Move(Vector3.zero,false)
            end
        end

        if isBeton then
            humanoid.Health = humanoid.MaxHealth
        end

        lastPos = root.Position
    end)
end

player.CharacterAdded:Connect(setup)
if player.Character then setup(player.Character) end


local function parseRoute(str)
    local t = {}
    for x,y,z in str:gmatch("{X=([%-%d%.]+),Y=([%-%d%.]+),Z=([%-%d%.]+)}") do
        table.insert(t, Vector3.new(tonumber(x),tonumber(y),tonumber(z)))
    end
    return t
end


